import React from "react";
import  "./header.css";

export const Header = () =>{
    return (
        <>
        <header>
            <div className="containner flexSB">
                <nav className="flexSB">
                  <div className="logo">
                    <img src="./images/logo.png" alt="" />
                  </div>
                  <ul className="flexSB">
                     <link to="/">home</link>
                  </ul>
                </nav>
            </div>
            </header>
            </>
    )
}

export default Header;
